pragma solidity ^0.4.19;

contract CarreraDeCaballos {

    struct Caballo {
        address id; //address;
        string nombreCaballo;
        string nombreJinete;
        uint edadCaballo;
        uint edadJinete;
        uint carrerasGanadas;
        uint carrerasTotales;
    }

    uint contador = 0;
    uint randNonce = 0;
    
    
    Caballo[] public caballos;

    event MostrarResultado(string ms, uint res);

    mapping (address => uint) public numeroCaballosPersona;


    modifier restriccion() {
        require(numeroCaballosPersona[msg.sender] < 1, "Solo se puede añadir un caballo por persona");
        _;
    }

    function crearCaballo(string _nombreCaballo, string _nombreJinete, uint _edadCaballo, uint _edadJinete) public restriccion returns (uint) {
        caballos.push(Caballo(msg.sender, _nombreCaballo, _nombreJinete, _edadCaballo, _edadJinete, 0, 0));
        numeroCaballosPersona[msg.sender]++;
        contador++;
        return contador;
    }

   function randMod() public returns(string) {
        randNonce++;
        uint256 result = uint256(keccak256(abi.encodePacked(now, caballos.length, randNonce))) % caballos.length;
        
        for (uint256 i = 0; i < caballos.length; i++) {
            if (result == i) {
                if (msg.sender == caballos[i].id) {
                    emit MostrarResultado("Has ganado", i);
                    //return "Has ganado";
                } else {
                    //return string(emit MostrarResultado("Has perdido", result));
                    //return string(abi.encodePacked("Has perdido, el ganador es: ", string(result)));
                    
                }
            }
        }
        
        
   }

}
